const employees = [
    {
        id: 1,
        name: 'John',
        surname: 'Doe',
        position: 'Manager',
        description: 'Description of John Doe',
        photo: 'john-doe.jpg',
    },
    {
        id: 2,
        name: 'Jane',
        surname: 'Smith',
        position: 'Developer',
        description: 'Description of Jane Smith',
        photo: 'jane-smith.jpg',
    },
    // Add more employees as needed
];

export default employees;
